// src/components/Navbar.js
import React from 'react';

const Navbar = ({ username, onLogout, tradeRequests }) => {
  return (
    <nav className="bg-gray-800 p-4 flex justify-between items-center">
      <div className="text-white">Welcome, {username}</div>
      <div className="flex items-center space-x-4">
        {tradeRequests > 0 && (
          <div className="bg-red-500 text-white rounded-full px-2 py-1">
            {tradeRequests} Trade Request
          </div>
        )}
        <button onClick={onLogout} className="text-white">Logout</button>
      </div>
    </nav>
  );
};

export default Navbar;
